class SoundConstroller extends Array{
	constructor(template) {
		super();
		this.template = template;
	}
	play() {
		let i = 0;
		while (i < this.length) {
			if (this[i].playing()) {
				i++;
			} else {
				this[i].play();
				return i;
			}
		}
		this.push(new Howl(this.template));
		this[i].play();
		return i;
	}
}

